import React from 'react';
import { Route } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';
import SearchBox from './SearchBox';
import { logout } from '../actions/userActions';

const Header = () => {
  const dispatch = useDispatch();

  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  const cartItems = useSelector((state) => state.cart.cartItems);

  const logoutHandler = () => {
    dispatch(logout());
  };

  const totalItems = cartItems.reduce((acc, item) => acc + item.qty, 0);
  const totalPrice = cartItems
    .reduce((acc, item) => acc + item.price * item.qty, 0)
    .toLocaleString('vi-VN', { style: 'currency', currency: 'VND' });

  return (
    <header>
      {/* Middle Header */}
      <div
        style={{
          backgroundColor: '#ffffff',
          padding: '8px 0',
          borderBottom: '1px solid #FFD700',
          position: 'sticky',
          top: 0,
          zIndex: 1000,
        }}
      >
        <Container className="d-flex justify-content-between align-items-center">
          {/* Logo */}
          <Link to="/" className="d-flex align-items-center">
            <img
              src="/images/logo/logo.png"
              alt="Logo"
              style={{
                maxHeight: '50px',
                marginRight: '10px',
              }}
            />
            <span
              style={{
                writingMode: 'vertical-rl',
                transform: 'rotate(180deg)',
                color: '#FF9900',
                fontSize: '14px',
                fontWeight: 'bold',
              }}
            >
              Laptop
            </span>
          </Link>

          {/* SearchBox */}
          <div style={{ flex: 1, maxWidth: '400px', margin: '0 20px' }}>
            <Route render={({ history }) => <SearchBox history={history} />} />
          </div>

          {/* Cart */}
          <div className="d-flex align-items-center">
            <Link
              to="/wishlist"
              className="cart-link"
              style={{ marginRight: '20px', color: '#FFD700', fontSize: '14px' }}
            >
              <i className="fas fa-heart"></i> Yêu thích
            </Link>
            <Link
              to="/cart"
              className="cart-link"
              style={{ color: '#FFD700', fontSize: '14px' }}
            >
              <i className="fas fa-shopping-cart"></i> {totalPrice} ({totalItems})
            </Link>
          </div>
        </Container>
      </div>

      {/* Navbar */}
      <Navbar
        style={{
          backgroundColor: '#FFD700',
          padding: '5px 0',
        }}
        expand="lg"
        variant="light"
      >
        <Container>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav
              className="mx-auto"
              style={{
                fontSize: '14px',
                fontWeight: '600',
                textTransform: 'uppercase',
                letterSpacing: '0.5px',
              }}
            >
              <Link to="/" className="nav-link" style={{ padding: '8px 12px' }}>
                Trang chủ
              </Link>
              <Link
                to="/storescreen"
                className="nav-link"
                style={{ padding: '8px 12px' }}
              >
                Cửa hàng
              </Link>
              <Link to="/contact" className="nav-link" style={{ padding: '8px 12px' }}>
                Liên hệ
              </Link>
              <Link to="/about" className="nav-link" style={{ padding: '8px 12px' }}>
                Tài khoản
              </Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
};

export default Header;
